This beautiful drink offers a number of “best of both” aspects that are personally appealing to me: a shared lineage between Chicago and New York, the happy marriage of bourbon and amaro, and a modern riff on a classic recipe. (See “The Last Word” in a recent post.) With 3/4s going to lemon juice, Aperol, and Nonino, this drink is light and bright with bourbon at the core. In an appropriate and delicious nod to Chicago, Koval Bourbon is a perfect choice here for the clean and sweet profile with a higher ABV (94 proof).

Equal parts of the following, shaken and double-strained:

@kovaldistillery Bourbon
@grappanonino Amaro Nonino
